import React from 'react'

const Item = (props) => {
  return (
    <div>
      <h3>Name : {props.name}</h3>
      <h4>Price : ${props.price}</h4>
      <button type="button">Add To Cart</button>
      <hr />
    </div>
  )
}

export default Item
